from web3 import Web3
from web3.middleware import geth_poa_middleware
import solcx
import pathlib
from web3_test_defs import contracts_dir
from web3_test import find_compiled_contract, print_tx_info

w3 = Web3(Web3.HTTPProvider('http://127.0.0.1:8545'))
w3.middleware_onion.inject(geth_poa_middleware, layer=0)
w3.eth.default_account = w3.eth.accounts[0]

contract_name = 'TestPlaceholderVerifierNonNativeFieldAdd'

def init_test1():
    params = dict()
    params['_test_name'] = "Placeholder proof verification for non native field add (case 1)"
    params['proof'] = ''

    params['init_params'] = []
    params['init_params'].append(
        28948022309329048855892746252171976963363056481941560715954676764349967630337)
    params['init_params'].append(3)
    params['init_params'].append(15)
    params['init_params'].append(1)
    params['init_params'].append(16)
    params['init_params'].append(14450201850503471296781915119640920297985789873634237091629829669980153907901)
    params['init_params'].append(10)
    D_omegas = []
    D_omegas.append(
        14450201850503471296781915119640920297985789873634237091629829669980153907901)
    D_omegas.append(
        199455130043951077247265858823823987229570523056509026484192158816218200659)
    D_omegas.append(
        24760239192664116622385963963284001971067308018068707868888628426778644166363)
    params['init_params'].append(len(D_omegas))
    params['init_params'].extend(D_omegas)
